$(function(){var serverBasic="http://"+location.host+"/",trTemplate='<tr class="odd gradeX">\n                            <td>{{Method}}</td>\n                            <td>{{Precent}}%</td>\n                            <td>{{Time}}s</td>\n                        </tr>',listCount=25,freshProfileList=function(e){$("#profile-list").html("");for(var t=0;t<e.length;t++)if(!e[t].error){var s=trTemplate.replace(/{{Method}}/g,e[t].Method).replace(/{{Precent}}/g,e[t].Precent.toFixed(2)).replace(/{{Time}}/g,e[t].Time.toFixed(2));$("#profile-list").append(s)}};setInterval(function(){$("#profile-panel").is(":visible")&&$.get(serverBasic+"/vm_profile_list/"+$("#vm-id").val()+"/"+listCount,function(response){$.get(serverBasic+"/vm_mon_info/"+$("#vm-id").val(),function(response){response=eval("("+response+")"),"success"==response.status?freshProfileList(response.data):console.log(response.message)})})},1e3),$(".profile-list-count").change(function(){listCount=$(this).val()})});